import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { ReservationProvider } from './ReservationContext'; // Importar el proveedor del contexto

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <ReservationProvider>
        <React.StrictMode>
            <App />
        </React.StrictMode>
    </ReservationProvider>
);
